import React from "react"

class Summary extends React.Component {
    render() {
        return (
            <div className='workspace-container-child'>
                <h1>DETAILS</h1>
                {this.props.item === null ? "Yes" : "nO"}
            </div>
        )
    }
}

export default Summary
